 document.addEventListener('DOMContentLoaded', function() {
            
            try {
                // Initialize Lucide icons
                lucide.createIcons();
            } catch (e) {
                console.error("Lucide icons failed to initialize.", e);
            }

            let products = [
                { name: "Pattachitra Scroll Painting", price: 2500, artisan: "Meena Devi", artisanContact: "+91-9876543210", image: "data:image/jpeg;base64," },
                { name: "Jaipur Blue Pottery Vase", price: 1800, artisan: "Suresh Kumar", artisanContact: "+91-9876543211", image: "data:image/jpeg;base64," },
                { name: "Handwoven Kutch Shawl", price: 4200, artisan: "Fatima Bai", artisanContact: "+91-9876543212", image: "data:image/jpeg;base64," },
                { name: "Traditional Warli Painting", price: 1500, artisan: "Ram Lal", artisanContact: "+91-9876543213", image: "data:image/jpeg;base64," },
                { name: "Channapatna Wooden Toys", price: 950, artisan: "Anjali Singh", artisanContact: "+91-9876543214", image: "data:image/jpeg;base64," },
                { name: "Bidriware Metal Inlay Box", price: 3100, artisan: "Ahmed Khan", artisanContact: "+91-9876543215", image: "data:image/jpeg;base64," },
                { name: "Kalamkari Hand-Painted Fabric", price: 2800, artisan: "Laxmi Rao", artisanContact: "+91-9876543216", image: "data:image/jpeg;base64," },
                { name: "Panchmura Terracotta Horse", price: 2250, artisan: "Rahul Ghosh", artisanContact: "+91-9876543217", image: "data:image/jpeg;base64," },
                { name: "Dhokra Lost-Wax Casting", price: 3500, artisan: "Gopal Varma", artisanContact: "+91-9876543218", image: "data:image/jpeg;base64," },
                { name: "Thanjavur Gold-Leaf Painting", price: 8500, artisan: "Vandana Iyer", artisanContact: "+91-9876543219", image: "data:image/jpeg;base64," }
            ];
            
            let lastGeneratedProduct = null;
            let uploadedImageData = null;
            let loggedInUser = null; // null, "customer", or "artisan"
            let cartItems = [];

            // --- Aesthetic improvements ---
            const header = document.querySelector('header');
            if (header) {
                window.addEventListener('scroll', () => {
                    if (window.scrollY > 10) {
                        header.classList.add('shadow-md');
                    } else {
                        header.classList.remove('shadow-md');
                    }
                });
            }

            const sectionsToAnimate = document.querySelectorAll('.animate-on-scroll');
            const observer = new IntersectionObserver((entries) => {
                entries.forEach(entry => {
                    if (entry.isIntersecting) {
                        entry.target.classList.add('is-visible');
                    }
                });
            }, { threshold: 0.1 });

            sectionsToAnimate.forEach(section => {
                observer.observe(section);
            });

            // --- Render Products on Page Load ---
            const renderProducts = () => {
                const productGrid = document.querySelector('#discover .grid');
                if (!productGrid) return;
                productGrid.innerHTML = ''; // Clear existing content
                products.forEach(product => {
                    const productHTML = `
                        <div class="feature-card bg-gray-50 rounded-lg overflow-hidden shadow-sm flex flex-col" data-name="${product.name}" data-price="${product.price}" data-image="${product.image}">
                            <img src="${product.image}" alt="${product.name}" class="w-full h-56 object-cover" onerror="this.onerror=null;this.src='https://placehold.co/600x400/FFF0E0/3f352e?text=Image+Not+Found';">
                            <div class="p-4 flex flex-col flex-grow">
                                <h3 class="font-bold text-xl mb-2">${product.name}</h3>
                                <p class="text-sm text-gray-600 mb-4 flex-grow">${product.description || ""}</p>
                                <div class="flex justify-between items-center mt-4">
                                    <p class="font-serif text-lg text-[#c77d45] font-bold">₹${product.price.toLocaleString('en-IN')}</p>
                                    <button class="add-to-cart-btn bg-[#c77d45] text-white font-semibold py-2 px-4 rounded-lg cta-button text-sm" data-name="${product.name}" data-price="${product.price}" data-image="${product.image}" data-artisan="${product.artisan}" data-contact="${product.artisanContact}">Add to Cart</button>
                                </div>
                            </div>
                        </div>
                    `;
                    productGrid.innerHTML += productHTML;
                });
            };
            renderProducts();

            // --- Robust Smooth Scroll for Anchor Links ---
            document.querySelectorAll('a[href^="#"]').forEach(anchor => {
                anchor.addEventListener('click', function (e) {
                    e.preventDefault();
                    const targetId = this.getAttribute('href');
                    const targetElement = document.querySelector(targetId);
                    if (targetElement) {
                        targetElement.scrollIntoView({ behavior: 'smooth' });
                    }
                });
            });
            
            // --- Mobile Menu Logic ---
            const mobileMenuBtn = document.getElementById('mobile-menu-btn');
            const mobileMenu = document.getElementById('mobile-menu');
            const mobileNavLinks = document.querySelectorAll('.mobile-nav-link');

            if (mobileMenuBtn && mobileMenu) {
                mobileMenuBtn.addEventListener('click', () => {
                    mobileMenu.classList.toggle('hidden');
                });
                
                mobileNavLinks.forEach(link => {
                    link.addEventListener('click', () => {
                        mobileMenu.classList.add('hidden');
                    });
                });
            }

            // --- Authentication Logic ---
            const customerTab = document.getElementById('customer-tab');
            const artisanTab = document.getElementById('artisan-tab');
            const customerFormContainer = document.getElementById('customer-form-container');
            const artisanFormContainer = document.getElementById('artisan-form-container');
            const loginFormContainer = document.getElementById('login-form-container');
            const artisanDashboard = document.getElementById('artisan-dashboard-container');
            
            const authButtonsDesktop = document.getElementById('auth-buttons-desktop');
            const profileViewDesktop = document.getElementById('profile-view-desktop');
            const profileLinkDesktop = document.getElementById('profile-link-desktop');

            const authButtonsMobile = document.getElementById('auth-buttons-mobile');
            const profileViewMobile = document.getElementById('profile-view-mobile');
            const profileLinkMobile = document.getElementById('profile-link-mobile');

            const logoutBtnDesktop = document.getElementById('logout-btn-desktop');
            const logoutBtnMobile = document.getElementById('logout-btn-mobile');

            const switchToRegister = (isArtisan) => {
                customerTab.classList.toggle('active', !isArtisan);
                artisanTab.classList.toggle('active', isArtisan);
                customerFormContainer.classList.toggle('hidden', isArtisan);
                artisanFormContainer.classList.toggle('hidden', !isArtisan);
                loginFormContainer.classList.add('hidden');
                artisanDashboard.classList.add('hidden');
            };
            
            const showLogin = () => {
                customerFormContainer.classList.add('hidden');
                artisanFormContainer.classList.add('hidden');
                artisanDashboard.classList.add('hidden');
                loginFormContainer.classList.remove('hidden');
            };

            const showArtisanDashboard = () => {
                 customerFormContainer.classList.add('hidden');
                 artisanFormContainer.classList.add('hidden');
                 loginFormContainer.classList.add('hidden');
                 artisanDashboard.classList.remove('hidden');
            };

            const updateUIAfterLogin = (userType) => {
                authButtonsDesktop.classList.add('hidden');
                profileViewDesktop.classList.remove('hidden');
                profileViewDesktop.classList.add('flex');
                authButtonsMobile.classList.add('hidden');
                profileViewMobile.classList.remove('hidden');

                if (userType === 'artisan') {
                    profileLinkDesktop.textContent = 'Artisan Dashboard';
                    profileLinkMobile.textContent = 'Artisan Dashboard';
                    showArtisanDashboard();
                } else {
                    profileLinkDesktop.textContent = 'My Profile';
                    profileLinkMobile.textContent = 'My Profile';
                    customerFormContainer.classList.add('hidden');
                    artisanFormContainer.classList.add('hidden');
                    loginFormContainer.classList.add('hidden');
                    artisanDashboard.classList.add('hidden');
                }
            };

            const updateUIAfterLogout = () => {
                authButtonsDesktop.classList.remove('hidden');
                profileViewDesktop.classList.add('hidden');
                profileViewDesktop.classList.remove('flex');
                authButtonsMobile.classList.remove('hidden');
                profileViewMobile.classList.add('hidden');
                switchToRegister(false); // Show customer registration form by default
            };
            
            const handleLogout = () => {
                loggedInUser = null;
                cartItems = []; // Clear cart on logout
                updateCartUI();
                updateUIAfterLogout();
                showNotification("You have been logged out successfully.");
            };

            logoutBtnDesktop.addEventListener('click', handleLogout);
            logoutBtnMobile.addEventListener('click', () => {
                handleLogout();
                mobileMenu.classList.add('hidden'); // Also close mobile menu
            });
            
            document.querySelectorAll('#login-link-desktop, #register-btn-desktop, #login-link-mobile, #register-btn-mobile').forEach(link => {
                link.addEventListener('click', (e) => {
                    const authSection = document.getElementById('auth-section');
                    if (authSection) authSection.scrollIntoView({ behavior: 'smooth' });
                    if (link.id.includes('login')) showLogin();
                    else switchToRegister(false);
                });
            });

            customerTab.addEventListener('click', () => switchToRegister(false));
            artisanTab.addEventListener('click', () => switchToRegister(true));
            document.getElementById('customer-login-link').addEventListener('click', (e) => { e.preventDefault(); showLogin(); });
            document.getElementById('artisan-login-link').addEventListener('click', (e) => { e.preventDefault(); showLogin(); });
            document.getElementById('register-link').addEventListener('click', (e) => { e.preventDefault(); switchToRegister(false); });

            document.getElementById('customer-register-form').addEventListener('submit', (e) => {
                e.preventDefault();
                loggedInUser = "customer";
                updateUIAfterLogin('customer');
                showNotification("Registration successful! You are now logged in.");
            });

            document.getElementById('artisan-register-form').addEventListener('submit', (e) => {
                e.preventDefault();
                loggedInUser = "artisan";
                updateUIAfterLogin('artisan');
                showNotification("Registration successful! Welcome to the Artisan Dashboard.");
            });

            document.getElementById('login-form').addEventListener('submit', (e) => {
                e.preventDefault();
                const email = document.getElementById('login-email').value;
                if (email.includes('artisan')) { // Mock login for artisans
                    loggedInUser = "artisan";
                    updateUIAfterLogin('artisan');
                     showNotification("Artisan login successful! Welcome.");
                } else { // Mock login for customers
                    loggedInUser = "customer";
                    updateUIAfterLogin('customer');
                    showNotification("Customer login successful!");
                }
            });

            // --- "How it works" section logic (Artisan AI Assistant) ---
            const steps = document.querySelectorAll('.step-indicator');
            const visuals = document.querySelectorAll('.step-visual');
            const generateListingBtn = document.getElementById('generate-listing-btn');
            const imageUploadInput = document.getElementById('artisan-image-upload');
            const imagePreview = document.getElementById('image-preview');
            const uploadPrompt = document.getElementById('upload-prompt');
            
            if (imageUploadInput) {
                imageUploadInput.addEventListener('change', (event) => {
                    const file = event.target.files[0];
                    if (file && file.type.startsWith('image/')) {
                        const reader = new FileReader();
                        reader.onload = (e) => {
                            uploadedImageData = e.target.result;
                            imagePreview.src = uploadedImageData;
                            imagePreview.classList.remove('hidden');
                            uploadPrompt.classList.add('hidden');
                        };
                        reader.readAsDataURL(file);
                    } else {
                         showNotification("Please select a valid image file.", true);
                         uploadedImageData = null;
                         imagePreview.classList.add('hidden');
                         uploadPrompt.classList.remove('hidden');
                    }
                });
            }
            
            const setActiveStep = (stepNumber) => {
                 steps.forEach((s, index) => {
                    if (index + 1 === stepNumber) {
                        s.classList.add('active');
                    } else {
                        s.classList.remove('active');
                    }
                });
                visuals.forEach((v, index) => {
                    if (index + 1 === stepNumber) {
                        v.classList.remove('hidden');
                    } else {
                        v.classList.add('hidden');
                    }
                });
            };

            if (generateListingBtn) {
                generateListingBtn.addEventListener('click', async () => {
                    const description = document.getElementById('artisan-description').value.trim();

                    if (loggedInUser !== "artisan") {
                        showNotification("You must be logged in as an artisan to use this feature.", true);
                        return;
                    }
                    if (!uploadedImageData || !description) {
                        showNotification("Please upload a photo and provide a description.", true);
                        return;
                    }
                    
                    setActiveStep(2); // Show loader

                    const systemPrompt = `You are a creative marketing expert for an Indian artisan marketplace. Your task is to take a simple description from an artisan and turn it into a beautiful, professional product listing. Generate a response in a valid JSON format.`;
                    const userPrompt = `Create a product listing based on this artisan's input:\n\n- Description: "${description}"\n\n- Image: An image of the described art has been provided.\n\nGenerate a JSON object with the following structure:\n- title: A creative, appealing title for the product.\n- description: An engaging, professional description (2-3 sentences).\n- price: A suggested price in Indian Rupees (as a number, e.g., 1500).\n- tags: An array of 3-5 relevant keywords (e.g., ["handmade", "madhubani", "decor"]).`;

                    const apiKey = "AIzaSyBV_S5ydM1anChbH0sMkYeW-gLI7-o7MYI";
                    const apiUrl = `https://generativelanguage.googleapis.com/v1beta/models/gemini-2.5-flash-preview-05-20:generateContent?key=${apiKey}`;
                    const payload = {
                        contents: [{ parts: [{ text: userPrompt }] }],
                        systemInstruction: { parts: [{ text: systemPrompt }] },
                        generationConfig: {
                            responseMimeType: "application/json",
                            responseSchema: {
                                type: "OBJECT",
                                properties: {
                                    "title": { "type": "STRING" },
                                    "description": { "type": "STRING" },
                                    "price": { "type": "NUMBER" },
                                    "tags": { "type": "ARRAY", "items": { "type": "STRING" } }
                                },
                                required: ["title", "description", "price", "tags"]
                            }
                        }
                    };
                    
                    try {
                        const response = await fetch(apiUrl, { method: 'POST', headers: { 'Content-Type': 'application/json' }, body: JSON.stringify(payload) });
                        if (!response.ok) throw new Error(`API error: ${response.statusText}`);
                        const result = await response.json();
                        const listingData = JSON.parse(result.candidates[0].content.parts[0].text);
                        
                        lastGeneratedProduct = {
                            name: listingData.title,
                            price: listingData.price,
                            description: listingData.description,
                            image: uploadedImageData,
                            artisan: "Meena Devi", // Mock artisan for demo
                            artisanContact: "+91-9876543210"
                        };

                        document.getElementById('listing-image').src = uploadedImageData;
                        document.getElementById('listing-title').textContent = listingData.title;
                        document.getElementById('listing-price').textContent = `₹${listingData.price.toLocaleString('en-IN')}`;
                        document.getElementById('listing-description').textContent = listingData.description;
                        const tagsContainer = document.getElementById('listing-tags');
                        tagsContainer.innerHTML = '';
                        listingData.tags.forEach(tag => {
                            tagsContainer.innerHTML += `<span class="tag-pill">${tag}</span>`;
                        });
                        
                        setActiveStep(3);

                    } catch(error) {
                        console.error("Listing Generation Error:", error);
                        showNotification("AI couldn't generate the listing. Please try again.", true);
                        setActiveStep(1); // Go back to input form
                    }
                });
            }
            
            const postToMarketBtn = document.getElementById('post-to-market-btn');
            if(postToMarketBtn) {
                postToMarketBtn.addEventListener('click', () => {
                    if (lastGeneratedProduct) {
                        products.unshift(lastGeneratedProduct); // Add to the beginning of the list
                        renderProducts();
                        showNotification(`"${lastGeneratedProduct.name}" is now live on the marketplace!`);
                        
                        // Reset form
                        lastGeneratedProduct = null;
                        uploadedImageData = null;
                        imagePreview.classList.add('hidden');
                        uploadPrompt.classList.remove('hidden');
                        imageUploadInput.value = '';
                        document.getElementById('artisan-description').value = '';

                        setActiveStep(1);
                        document.querySelector('#discover').scrollIntoView({ behavior: 'smooth' });
                    } else {
                        showNotification("No generated product to post.", true);
                    }
                });
            }

            // --- Co-creation "Bring Your Vision to Life" Logic ---
            const visionForm = document.getElementById('vision-form');
            const visionUpload = document.getElementById('vision-upload');
            const visionPreview = document.getElementById('vision-preview');
            const visionUploadPrompt = document.getElementById('vision-upload-prompt');
            const artisanMatchResults = document.getElementById('artisan-match-results');
            const artisanMatchView = document.getElementById('artisan-match-view');
            const matchedArtisansList = document.getElementById('matched-artisans-list');
            
            const artisansData = [
                { name: 'Meena Devi', craft: 'Madhubani Painter', image: 'https://images.unsplash.com/photo-1541696492348-84223b5d36e2?q=80&w=1964&auto=format&fit=crop', contact: '+91-9876543210' },
                { name: 'Suresh Kumar', craft: 'Terracotta Potter', image: 'https://images.unsplash.com/photo-1600713002627-9b4860ae2e61?q=80&w=2070&auto=format&fit=crop', contact: '+91-9876543211' },
                { name: 'Fatima Bai', craft: 'Rabari Embroiderer', image: 'https://images.unsplash.com/photo-1620766165522-6522a13b9663?q=80&w=1964&auto=format&fit=crop', contact: '+91-9876543212' }
            ];

            if (visionUpload) {
                visionUpload.addEventListener('change', (event) => {
                    const file = event.target.files[0];
                    if (file && file.type.startsWith('image/')) {
                        const reader = new FileReader();
                        reader.onload = (e) => {
                            visionPreview.src = e.target.result;
                            visionPreview.classList.remove('hidden');
                            visionUploadPrompt.classList.add('hidden');
                        };
                        reader.readAsDataURL(file);
                    } else {
                        visionPreview.classList.add('hidden');
                        visionUploadPrompt.classList.remove('hidden');
                    }
                });
            }

            if (visionForm) {
                visionForm.addEventListener('submit', (e) => {
                    e.preventDefault();
                    if (loggedInUser !== "customer") {
                        showNotification("You must be logged in as a customer to create a custom request.", true);
                        return;
                    }
                    const description = document.getElementById('vision-description').value;
                    const findArtisanBtn = document.getElementById('find-artisan-btn');
                    const btnText = document.getElementById('find-artisan-btn-text');
                    const loader = document.getElementById('find-artisan-loader');

                    if (!description.trim()) {
                        showNotification("Please describe your idea to find an artisan.", true);
                        return;
                    }

                    // Show loading state
                    btnText.textContent = "Matching...";
                    loader.classList.remove('hidden');
                    findArtisanBtn.disabled = true;

                    // Simulate AI matching
                    setTimeout(() => {
                        artisanMatchView.classList.add('hidden');
                        artisanMatchResults.classList.remove('hidden');
                        matchedArtisansList.innerHTML = '';

                        // Simple random match for demonstration
                        const shuffledArtisans = [...artisansData].sort(() => 0.5 - Math.random());
                        const matchedArtisans = shuffledArtisans.slice(0, 2);

                        matchedArtisans.forEach(artisan => {
                            const artisanHTML = `
                                <div class="bg-white p-3 rounded-lg shadow-sm flex items-center gap-4">
                                    <img src="${artisan.image}" alt="${artisan.name}" class="w-16 h-16 object-cover rounded-full">
                                    <div class="flex-grow">
                                        <p class="font-bold">${artisan.name}</p>
                                        <p class="text-sm text-gray-500">${artisan.craft}</p>
                                        <p class="text-sm text-gray-500 font-semibold">Contact: ${artisan.contact}</p>
                                    </div>
                                    <button class="bg-[#c77d45] text-white text-sm font-semibold py-2 px-3 rounded-lg cta-button">Contact</button>
                                </div>
                            `;
                            matchedArtisansList.innerHTML += artisanHTML;
                        });
                        
                        showNotification("We've found artisans who can bring your vision to life!");
                        
                        // Reset button
                        btnText.textContent = "Find an Artisan";
                        loader.classList.add('hidden');
                        findArtisanBtn.disabled = false;
                        
                    }, 2500); // Simulate network delay
                });
            }

            // --- Personalized Gift Finder Logic ---
            const giftFinderForm = document.getElementById('gift-finder-form');
            const giftPhotoUpload = document.getElementById('gift-photo-upload');
            const giftPhotoPreview = document.getElementById('gift-photo-preview');
            const giftPhotoPrompt = document.getElementById('gift-photo-prompt');
            const giftResultsPlaceholder = document.getElementById('gift-results-placeholder');
            const giftResultsContainer = document.getElementById('gift-results');

            const giftIdeas = [
                { idea: "Hand-painted Madhubani box", artisan: "Meena Devi", image: "https://images.unsplash.com/photo-1596792344883-2ec3b85f21f1?q=80&w=2070&auto=format&fit=crop" },
                { idea: "Custom-engraved Bidriware plate", artisan: "Ahmed Khan", image: "https://plus.unsplash.com/premium_photo-1678402864009-a41253131d57?q=80&w=2070&auto=format&fit=crop" },
                { idea: "Terracotta wall hanging with a name", artisan: "Suresh Kumar", image: "https://images.unsplash.com/photo-1600713002627-9b4860ae2e61?q=80&w=2070&auto=format&fit=crop" }
            ];

            if (giftPhotoUpload) {
                giftPhotoUpload.addEventListener('change', (event) => {
                    const file = event.target.files[0];
                    if (file && file.type.startsWith('image/')) {
                        const reader = new FileReader();
                        reader.onload = (e) => {
                            giftPhotoPreview.src = e.target.result;
                            giftPhotoPreview.classList.remove('hidden');
                            giftPhotoPrompt.classList.add('hidden');
                        };
                        reader.readAsDataURL(file);
                    } else {
                        giftPhotoPreview.classList.add('hidden');
                        giftPhotoPrompt.classList.remove('hidden');
                    }
                });
            }

            if (giftFinderForm) {
                giftFinderForm.addEventListener('submit', (e) => {
                    e.preventDefault();
                    const occasion = document.getElementById('occasion').value;
                    const recipientName = document.getElementById('recipient-name').value;
                    const preferences = document.getElementById('preferences').value;
                    const findGiftBtn = document.getElementById('find-gift-btn');
                    const btnText = document.getElementById('find-gift-btn-text');
                    const loader = document.getElementById('gift-finder-loader');
                    
                    if (loggedInUser !== "customer") {
                        showNotification("You must be logged in as a customer to use the gift finder.", true);
                        return;
                    }

                    if (!occasion.trim() || !recipientName.trim() || !preferences.trim()) {
                        showNotification("Please fill in all required fields.", true);
                        return;
                    }

                    // Show loading state
                    btnText.textContent = "Generating Ideas...";
                    loader.className = 'loader'; // Use the main loader style
                    loader.style.width = '20px';
                    loader.style.height = '20px';
                    loader.style.borderTopColor = 'white';
                    loader.style.borderWidth = '3px';
                    loader.classList.remove('hidden');
                    findGiftBtn.disabled = true;

                    setTimeout(() => {
                        giftResultsPlaceholder.classList.add('hidden');
                        giftResultsContainer.classList.remove('hidden');
                        giftResultsContainer.innerHTML = '';

                        const shuffledIdeas = [...giftIdeas].sort(() => 0.5 - Math.random());
                        
                        shuffledIdeas.slice(0, 2).forEach(gift => {
                            const giftHTML = `
                                <div class="bg-white p-4 rounded-lg shadow-sm">
                                    <img src="${gift.image}" alt="${gift.idea}" class="w-full h-40 object-cover rounded-md mb-3">
                                    <p class="font-bold">For ${recipientName}: ${gift.idea}</p>
                                    <p class="text-sm text-gray-600 mb-3">A perfect gift for a ${occasion}, reflecting their love for ${preferences.split(',')[0].trim()}.</p>
                                    <p class="text-sm text-gray-500 mb-3">Can be crafted by: <span class="font-semibold">${gift.artisan}</span></p>
                                    <button class="w-full bg-[#c77d45] text-white text-sm font-semibold py-2 px-3 rounded-lg cta-button">Connect with Artisan</button>
                                </div>
                            `;
                            giftResultsContainer.innerHTML += giftHTML;
                        });
                        
                        showNotification(`Gift ideas for ${recipientName} are ready!`);
                        
                        // Reset button
                        btnText.textContent = "Find My Perfect Gift";
                        loader.classList.add('hidden');
                        findGiftBtn.disabled = false;
                    }, 2500);
                });
            }

            // --- Cart & Checkout Logic ---
            const cartItemsContainer = document.getElementById('cart-items');
            const cartTotalSpan = document.getElementById('cart-total');
            const checkoutBtn = document.getElementById('checkout-btn');
            const cartCountSpan = document.getElementById('cart-count');
            const paymentModal = document.getElementById('payment-modal');
            const backToCartBtn = document.getElementById('back-to-cart-btn');
            const confirmationModal = document.getElementById('confirmation-modal');
            const closeConfirmationModalBtn = document.getElementById('close-confirmation-modal');
            const orderSummaryItems = document.getElementById('order-summary-items');
            const orderSummaryTotal = document.getElementById('order-summary-total');
            const orderSummaryArtisan = document.getElementById('order-summary-artisan');


            const updateCartUI = () => {
                let total = 0;
                const totalQuantity = cartItems.reduce((sum, item) => sum + item.quantity, 0);

                if (cartItems.length === 0) {
                    cartItemsContainer.innerHTML = '<p class="text-gray-500 text-center mt-8">Your cart is empty.</p>';
                    checkoutBtn.disabled = true;
                } else {
                    cartItemsContainer.innerHTML = '';
                    checkoutBtn.disabled = false;
                    cartItems.forEach((item, index) => {
                        const itemHTML = `
                            <div class="flex items-center gap-4 py-4 border-b last:border-b-0">
                                <img src="${item.image}" class="w-16 h-16 object-cover rounded-lg" alt="${item.name}">
                                <div class="flex-grow">
                                    <p class="font-semibold">${item.name}</p>
                                    <p class="text-sm text-gray-500">₹${item.price.toLocaleString('en-IN')}</p>
                                </div>
                                <div class="flex items-center gap-2">
                                     <button class="quantity-btn decrease-qty" data-index="${index}">-</button>
                                     <span class="w-5 text-center">${item.quantity}</span>
                                     <button class="quantity-btn increase-qty" data-index="${index}">+</button>
                                </div>
                                <button class="text-red-500 hover:text-red-700 remove-item" data-index="${index}">
                                    <i data-lucide="trash-2" class="w-5 h-5"></i>
                                </button>
                            </div>
                        `;
                        cartItemsContainer.innerHTML += itemHTML;
                        total += item.price * item.quantity;
                    });
                }
                cartTotalSpan.textContent = `₹${total.toLocaleString('en-IN')}`;
                cartCountSpan.textContent = totalQuantity;
                lucide.createIcons();
            };

            const handleAddToCartClick = (button) => {
                if (loggedInUser !== "customer") {
                    showNotification("Please log in as a customer to add items to your cart.", true);
                    document.querySelector('#auth-section').scrollIntoView({ behavior: 'smooth' });
                    return;
                }

                const name = button.dataset.name;
                const price = parseFloat(button.dataset.price);
                const image = button.dataset.image;
                const artisan = button.dataset.artisan;
                const contact = button.dataset.contact;

                const existingItem = cartItems.find(item => item.name === name);
                if (existingItem) {
                    existingItem.quantity++;
                } else {
                    cartItems.push({ name, price, image, quantity: 1, artisan, contact });
                }
                updateCartUI();
                showNotification(`Added ${name} to cart!`);

                const cartIcon = document.getElementById('cart-toggle-btn');
                cartIcon.classList.add('transform', 'scale-125', 'transition-transform', 'duration-300');
                setTimeout(() => {
                    cartIcon.classList.remove('transform', 'scale-125');
                }, 300);
            };

            document.body.addEventListener('click', function(event) {
                const button = event.target.closest('.add-to-cart-btn');
                if (button) {
                    handleAddToCartClick(button);
                }
            });
            
            cartItemsContainer.addEventListener('click', (e) => {
                const decreaseBtn = e.target.closest('.decrease-qty');
                const increaseBtn = e.target.closest('.increase-qty');
                const removeBtn = e.target.closest('.remove-item');

                if (decreaseBtn) {
                    const index = decreaseBtn.dataset.index;
                    if (cartItems[index].quantity > 1) {
                        cartItems[index].quantity--;
                    } else {
                        cartItems.splice(index, 1);
                    }
                } else if (increaseBtn) {
                    const index = increaseBtn.dataset.index;
                    cartItems[index].quantity++;
                } else if (removeBtn) {
                    const index = removeBtn.dataset.index;
                    cartItems.splice(index, 1);
                }
                updateCartUI();
            });

            // Show/Hide Cart Modal
            const cartModal = document.getElementById('cart-modal');
            const toggleCart = () => {
                const isActive = cartModal.classList.toggle('active');
                if (isActive) {
                     setTimeout(() => lucide.createIcons(), 10);
                }
            };

            document.getElementById('cart-toggle-btn').addEventListener('click', toggleCart);
            document.getElementById('close-cart-btn').addEventListener('click', toggleCart);
            
            cartModal.addEventListener('click', (event) => {
                if (event.target === cartModal) { 
                    toggleCart();
                }
            });

            // Open Payment Modal
            checkoutBtn.addEventListener('click', () => {
                if(cartItems.length === 0) {
                    showNotification("Your cart is empty.", true);
                    return;
                }
                toggleCart(); // Close the cart modal
                setTimeout(() => paymentModal.classList.add('active'), 300);
            });
            
            backToCartBtn.addEventListener('click', () => {
                paymentModal.classList.remove('active');
                setTimeout(() => toggleCart(), 300);
            });

            // Handle Payment Form Submission
            document.getElementById('payment-form').addEventListener('submit', (e) => {
                e.preventDefault();
                paymentModal.classList.remove('active');
                
                let total = 0;
                orderSummaryItems.innerHTML = '';
                const artisans = new Map();

                cartItems.forEach(item => {
                    const itemTotal = item.quantity * item.price;
                    total += itemTotal;
                    orderSummaryItems.innerHTML += `
                        <div class="flex justify-between">
                            <span>${item.quantity} x ${item.name}</span>
                            <span>₹${itemTotal.toLocaleString('en-IN')}</span>
                        </div>
                    `;
                    if (!artisans.has(item.artisan)) {
                        artisans.set(item.artisan, item.artisanContact);
                    }
                });

                orderSummaryTotal.textContent = `₹${total.toLocaleString('en-IN')}`;
                
                orderSummaryArtisan.innerHTML = '';
                artisans.forEach((contact, name) => {
                     orderSummaryArtisan.innerHTML += `
                        <div>
                            <span class="font-semibold">${name}:</span>
                            <span>${contact}</span>
                        </div>
                     `;
                });

                setTimeout(() => {
                    confirmationModal.classList.add('active');
                    cartItems = [];
                    updateCartUI();
                }, 300);
            });

            closeConfirmationModalBtn.addEventListener('click', () => {
                confirmationModal.classList.remove('active');
            });

            // --- Stall Registration Form Logic ---
            const stallForm = document.getElementById('stall-registration-form');
            if (stallForm) {
                stallForm.addEventListener('submit', (e) => {
                    e.preventDefault();
                    const artisanNameInput = document.getElementById('artisan-name');
                    if(artisanNameInput && artisanNameInput.value) {
                         showNotification(`Thank you, ${artisanNameInput.value}! Your interest has been registered.`);
                         stallForm.reset();
                    } else {
                         showNotification('Your interest has been registered. Thank you!');
                         stallForm.reset();
                    }
                });
            }
            
            // --- Exhibition Search Logic ---
            const locationSearchInput = document.getElementById('location-search');
            const searchBtn = document.getElementById('search-btn');
            const exhibitionList = document.getElementById('exhibition-list');
            const noResultsMsg = document.getElementById('no-exhibitions-found');

            const filterExhibitions = () => {
                if (!locationSearchInput || !exhibitionList || !noResultsMsg) return;
                
                const searchTerm = locationSearchInput.value.toLowerCase().trim();
                const cards = exhibitionList.querySelectorAll('.exhibition-card');
                let visibleCount = 0;

                cards.forEach(card => {
                    const locationElement = card.querySelector('.event-location');
                    if (locationElement) {
                        const locationText = locationElement.textContent.toLowerCase();
                        if (locationText.includes(searchTerm)) {
                            card.style.display = 'flex';
                            visibleCount++;
                        } else {
                            card.style.display = 'none';
                        }
                    }
                });

                if (visibleCount === 0) {
                    noResultsMsg.classList.remove('hidden');
                } else {
                    noResultsMsg.classList.add('hidden');
                }
            };
            
            if (searchBtn) {
                 searchBtn.addEventListener('click', filterExhibitions);
            }
            
            if (locationSearchInput) {
                locationSearchInput.addEventListener('keyup', (e) => {
                     filterExhibitions();
                });
            }
            
            // --- Chatbot Logic ---
            const chatBubble = document.getElementById('chat-bubble');
            const chatWindow = document.getElementById('chat-window');
            const closeChatBtn = document.getElementById('close-chat');
            const chatForm = document.getElementById('chat-form');
            const chatInput = document.getElementById('chat-input');
            const chatMessages = document.getElementById('chat-messages');

            chatBubble.addEventListener('click', () => {
                chatWindow.classList.remove('scale-95', 'opacity-0', 'pointer-events-none');
                chatWindow.classList.add('scale-100', 'opacity-100', 'pointer-events-auto');
                lucide.createIcons();
            });

            closeChatBtn.addEventListener('click', () => {
                chatWindow.classList.add('scale-95', 'opacity-0', 'pointer-events-none');
                chatWindow.classList.remove('scale-100', 'opacity-100', 'pointer-events-auto');
            });

            chatForm.addEventListener('submit', async (e) => {
                e.preventDefault();
                const userInput = chatInput.value.trim();
                if (!userInput) return;

                chatMessages.innerHTML += `
                    <div class="flex justify-end mb-4 fade-in">
                        <div class="bg-gray-200 text-gray-800 p-3 rounded-lg max-w-xs shadow">
                            <p class="text-sm">${userInput}</p>
                        </div>
                    </div>
                `;
                chatMessages.scrollTop = chatMessages.scrollHeight;
                chatInput.value = '';

                const typingIndicator = document.createElement('div');
                typingIndicator.className = 'flex mb-4 fade-in typing-indicator-container';
                typingIndicator.innerHTML = `
                    <div class="bg-gray-300 p-3 rounded-lg shadow">
                        <div class="typing-indicator">
                            <span></span><span></span><span></span>
                        </div>
                    </div>
                `;
                chatMessages.appendChild(typingIndicator);
                chatMessages.scrollTop = chatMessages.scrollHeight;

                const apiKey = "AIzaSyBV_S5ydM1anChbH0sMkYeW-gLI7-o7MYI";
                const apiUrl = `https://generativelanguage.googleapis.com/v1beta/models/gemini-2.5-flash-preview-05-20:generateContent?key=${apiKey}`;
                const payload = {
                    contents: [{ parts: [{ text: `You are an AI assistant for an Indian artisan marketplace called TechneAI. Be helpful and knowledgeable about Indian art forms. Keep your answers concise. User says: "${userInput}"` }] }]
                };

                try {
                    const response = await fetch(apiUrl, { method: 'POST', headers: { 'Content-Type': 'application/json' }, body: JSON.stringify(payload) });
                    if (!response.ok) throw new Error(`API Error: ${response.statusText}`);
                    
                    const result = await response.json();
                    const aiResponse = result.candidates[0].content.parts[0].text;

                    typingIndicator.remove();
                    chatMessages.innerHTML += `
                        <div class="flex mb-4 fade-in">
                            <div class="bg-[#c77d45] text-white p-3 rounded-lg max-w-xs shadow">
                                <p class="text-sm">${aiResponse}</p>
                            </div>
                        </div>
                    `;
                } catch (error) {
                    console.error('Chatbot API error:', error);
                    typingIndicator.remove();
                     chatMessages.innerHTML += `
                        <div class="flex mb-4 fade-in">
                            <div class="bg-red-500 text-white p-3 rounded-lg max-w-xs shadow">
                                <p class="text-sm">Sorry, I'm having trouble connecting right now. Please try again later.</p>
                            </div>
                        </div>
                    `;
                } finally {
                    chatMessages.scrollTop = chatMessages.scrollHeight;
                }
            });

            // --- Notification Logic ---
            const showNotification = (message, isError = false) => {
                const notification = document.createElement('div');
                notification.textContent = message;
                notification.className = `fixed top-24 right-6 text-white py-2 px-5 rounded-lg shadow-lg text-sm transition-all duration-500 transform translate-x-full z-[1200]`;
                notification.classList.add(isError ? 'bg-red-500' : 'bg-green-600');
                
                document.body.appendChild(notification);
                
                setTimeout(() => {
                    notification.classList.remove('translate-x-full');
                }, 100);

                setTimeout(() => {
                    notification.classList.add('translate-x-full');
                    setTimeout(() => {
                        notification.remove();
                    }, 500);
                }, 3000);
            };

            updateCartUI();
            
        });
    
